drive = GoogleDrive(self.ga)
flist = drive.ListFile({'q': "title = '%s' and trashed = false" % self.title})
files = flist.GetList()
for file1 in self.file_list:
    found = False
    for file2 in files:
        if file1['id'] == file2['id']:
            found = True
    self.assertEqual(found, True)
